    @Test
    public void getAPathTest()
    {
        System.out.println("Get a path Test: \n");
        final int[][] maze = 
        {
            {0, 0, 0, 0},
            {1, 1, 0, 1},
            {0, 1, 0, 0},
        };

        for(int x = 0; x < 3; x++)
        {
            System.out.print("{");
            for(int y = 0; y < 4; y++)
            {
                System.out.print(maze[x][y] + ",");
            }
            System.out.println("}");
        }

        final Coordinate start = new Coordinate(0, 0);
        final Coordinate end = new Coordinate(2, 3);
        final List<Coordinate> path = GraphsAndMazes.searchMaze(maze, start, end);
        System.out.println("\nStart: (" + start.x + "," + start.y + ")" + " Finish: (" + end.x + "," + end.y + ")");
        System.out.println("path = " + path);
        System.out.println("\n");

        //printLargeArray();
    }

