    public void speedTest()
    {
        List<Double> times = new ArrayList<>();
        List<Double> sizes =  new ArrayList<>();
        try
        {    
            System.out.println("\nSpeed Test: \n");
            int[][]maze;
            for(int i = 5; i < 15000; i*=2)
            {
                maze = new int[i][i];
                for(int rows = 0; rows < maze.length; rows++)
                {
                    for(int columns = 0; columns < maze[0].length; columns++)
                    {
                        int r = getRandomInteger(2);
                        if(r != 0 )
                        {
                            r = getRandomInteger(2);
                        }
                        maze[rows][columns] = r;
                    }
                }
                int rX1 = getRandomInteger(maze.length);
                int rX2 = getRandomInteger(maze.length);
                int rY1 = getRandomInteger(maze[0].length);
                int rY2 = getRandomInteger(maze[0].length);
                final Coordinate start = new Coordinate(rX1, rY1);
                final Coordinate end = new Coordinate(rX2, rY2);

                long startTime = System.nanoTime();

                final List<Coordinate> path = GraphsAndMazes.searchMaze(maze, start, end);
                System.out.println("\nStart: (" + start.x + "," + start.y + ")" + " Finish: (" + end.x + "," + end.y + ")");
                //System.out.println("path = " + path);
                System.out.println("\n");
                
                long endTime = System.nanoTime();
                long totalTime = endTime-startTime;
                double seconds = (double) totalTime/1000000000;

                System.out.println("it took " + seconds);
                System.out.println("With a path length of: " + path.size());
                times.add(seconds);
                sizes.add((double) maze.length*maze[0].length);
            }
        }
            catch(Exception e)
            {
                System.err.println("\nException thrown: " + e);
            }
            int line = 1;
            List<Double> slopes = new ArrayList<>();
            for(Double d: times)
            {
                System.out.println(line + ". Time: " + d);
                if(line < times.size()-1)
                {
                    double logY1 = Math.log(times.get(line-1));
                    double logY2 = Math.log(times.get(line));
                    double logX1 = Math.log(sizes.get(line-1));
                    double logX2 = Math.log(sizes.get(line));
                    double logSlope = (logX1 - logX2)/(logY1 - logY2);
                    if(logY1 != 0 && logY2 != 0 && logX1 != 0 && logX2 != 0)
                    { 
                        slopes.add(logSlope);
                    }
                }
                line++;
            }
            double total = 0;
            for(double d: slopes)
            {
                total+=d;
            }
            double average = total/slopes.size();
            //System.out.println("\nDoubling ratio: " + average +"\n");
        }

